import React from 'react';
import { Navbar,Container,} from 'react-bootstrap';
import{Link} from 'react-router-dom';

function Navbar1(){
    return(
      <div className="container-fluid ">

      <Link to="/About" class="nav-link mx-2 ">About</Link>
      <Navbar1 collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Container>
  <Navbar1.Brand href="#home">React-Bootstrap</Navbar1.Brand>
  <Navbar1.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar1.Collapse id="responsive-navbar-nav">
    <Nav className="me-auto">
      <Nav.Link href="#"><Link to="/About" class="nav-link mx-2 ">About</Link></Nav.Link>
      <Nav.Link href="#">Pricing</Nav.Link>
      <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>       
      </NavDropdown>
    </Nav>    
  </Navbar1.Collapse>
  </Container>
</Navbar1>
      </div>
    );
}

export default Navbar1;
